import React, { Component } from 'react';
import './App.css';
import './style.css';

import Home from "./pages/Home";
// import Rooms from "./pages/Rooms";
// import SingleRooms from "./pages/SingleRoom";
import Errors from "./pages/Error";
// import FeaturedRooms from './components/FeaturedRooms';

import {Route, Switch, BrowserRouter as Router} from 'react-router-dom';
import Navbar from './components/Navbar';
// import App1 from './components/App1';
import Page1 from './pages/Page1';
import Page2 from './pages/Page2';
import PrivacyPage from './components/sections/PrivacyPage';
import Login from './pages/Login';

class App extends Component {
	 render() {
	 	return(
			<>
			<Navbar />
			<Router>
				<Switch>
					<Route exact path="/" component={Home}/>
					<Route exact path="/page1" component={Page2}/>
					<Route exact path="/page2" component={Page1}/>
					<Route exact path="/page3" component={Home}/>
					<Route exact path="/login" component={Login}/>
					<Route component={Errors} />
				</Switch>
			</Router>
			</>

  );
	}
}

export default App;
